import React from 'react';
import './Home.css'
import Merle from '../../../img/pups2.jpg'
import TwoDogs from '../../../img/doggys.jpg'

function Home() {
    return (
        <section className="home-section">
           <div className='container-box'>
           <img className='merle-dog' src={Merle}/>
           <div className="centered"> Hello </div>
           </div>
           <div className='container-box'>
           <img className='merle-dog' src={TwoDogs}/>
           <div className="centered"> Hello </div>
           </div>
        </section>
    );
}

export default Home;
